// import "bootstrap/dist/css/bootstrap.min.css";
import {FontAwesomeIcon} from "@fortawesome/react-fontawesome";
import { faSearch } from '@fortawesome/free-solid-svg-icons';
// import {Link} from "react-router-dom";
import { faGoogle, faTwitter, faInstagram, faYoutube } from '@fortawesome/free-brands-svg-icons';
// import { faSearch } from '@fortawesome/free-brands-svg-icons';
import cardObj from "./mockData";
import './BookShelves.css';

export const BookCard=(props)=>{
  const{cardData}=props;
    return(
        <div className="cards-main-container">
            <div className="card-div">
                <img className="card-image" src={cardData.ThumbnailURL} alt="No_image"/>
                <div className="books-details-div">
                    <h6 className="font-for-all heading">{cardData.title}</h6>
                    <p className="font-for-all descrition">{cardData.contributor}</p>
                    <div className="rating-div">
                        <p className="font-for-all">Avg Rating: </p>
                        <p className="font-for-all">{cardData.ratings}</p>
                    </div>
                    <p className="font-for-all">Status:<a className="font-for-all" href="#0">Read</a></p>
                </div>
            </div>
        </div>
    )
}

const Bookshelves=()=>{

    return(
        <div className="main-divcontainer">
            <nav className="navigationbar">
                {/* <div className="container-fluid"> */}
                    <a className="navbar-brandimg" href="$"><img className="brandlogo" src="/images/Homelogo1.png" alt="homelogo"/></a>
                    <form className="formitemscontainer">
                        {/* <Link to="/home">
                          <h6 className="nav-home">Home</h6>
                        </Link> */}
                        <h6 className="nav-home">Home</h6>
                        <h6 className="nav-bookshelves">bookshelves</h6>
                        <button className="nav-btn" type="submit">logout</button>
                    </form>
                {/* </div> */}
            </nav>
            <div className="second-div">
                <div className="second-main-div">
                    <div className="categories-div">
                        <h5>BookShelves</h5>
                        <div className="categorieitems-div">
                            <h6 className="All">All</h6>
                            <h6 className="headingiteams">Read</h6>
                            <h6 className="headingiteams">Currently Reading</h6>
                            <h6 className="headingiteams">Want to Read</h6>
                        </div>
                    </div>
                    <div className="bookscontainer">
                        <div className="search-bar-div">
                            <h6>All Books</h6>
                            <div className="text-div">
                                <input type="text" className="form-control" placeholder="Search books..." aria-label="Search books" aria-describedby="search-icon" />
                                <span className="input-group-text">
                                    <FontAwesomeIcon icon={faSearch}/>
                                </span>
                            </div>
                        </div>
                        <div className="dynamic-div">
                          {
                            cardObj.map((bookCard)=>(
                              <BookCard key={bookCard} cardData={bookCard}/>
                            ))
                          }
                            {/* {<BookCard 
                              cardData={cardObj}
                            />} */}
                        </div>
                    </div>
                </div>
            </div>
            <div className="footer-icons">
                <FontAwesomeIcon icon={faGoogle}/>
                <FontAwesomeIcon icon={faTwitter}/>
                <FontAwesomeIcon icon={faInstagram}/>
                <FontAwesomeIcon icon={faYoutube}/>
            </div>
            <div className="footer">
                <p>Contact Us</p>
            </div>
        </div>
    ) 
}

export default Bookshelves;
